  projects: PropTypes.array,
  onGetProjects: PropTypes.func,
  onAddNewProject: PropTypes.func,
  t: PropTypes.any
};

const mapStateToProps = ({
  projects
}) => ({
  projects: projects.projects
});

const mapDispatchToProps = dispatch => ({
  onGetProjects: () => dispatch(getProjects()),
  onAddNewProject: project => dispatch(addNewProject(project))
});

export default connect(mapStateToProps, mapDispatchToProps)(withRouter(withTranslation()(ProjectsCreate)));

